" x="11.28" y="0">4</tspan></text><text class="cls-5" transform="translate(384.12 515.28)">Em 2018, Bolsonaro criticou uma<tspan x="0" y="12.5">das questões do Enem e disse que,</tspan><tspan x="0" y="25">em seu governo, tomaria conhecimento</tspan><tspan x="0" y="37.5">do conteúdo antes da distribuição da prova.</tspan><tspan x="0" y="50">No entanto, Vicenzi afirmou que o </tspan><tspan x="0" y="62.5">presidente não pediu para ler o </tspan><tspan x="0" y="75">exame de 2019</tspan></text><text class="cls-6" transform="translate(498.96 139.28)"><tspan class="cls-7">1</tspan><tspan x="10.95" y="0">5</tspan></text><text class="cls-5" transform="translate(535.12 101.28)">Em sessão no plenário da Câmara<tspan x="0" y="12.5">dos Deputados, o ministro da Educação</tspan><tspan x="0" y="25">afirmou não ser responsável pelo atual</tspan><tspan x="0" y="37.5">contingenciamento de verbas da pasta.</tspan><tspan x="0" y="50">Ainda afirmou que a prioridade do governo</tspan><tspan x="0" y="62.5">é o ensino básico, fundamental e técnico</tspan></text><text class="cls-8" transform="translate(656.96 479.28)"><tspan class="cls-9">1</tspan><tspan x="12.51" y="0">5M</tspan></text><text class="cls-10" transform="translate(626.71 496.28)">O primeiro Tsunami da Educação<tspan x="-12.11" y="10">ocupou as ruas de 200 cidades do país.</tspan><tspan x="-2.15" y="20">O estopim da manifestação foram</tspan><tspan x="-15.44" y="30">os diversos cortes no orçamento do setor,</tspan><tspan x="-13.82" y="40">realizados pelo MEC. A Educação Básica,</tspan><tspan x="-3.98" y="50">por exemplo, teve R$ 2,4 bilhões em</tspan><tspan x="13.83" y="60">investimentos bloqueados</tspan></text><text class="cls-11" transform="translate(662.02 577.28)" style="cursor: pointer" onclick="openModal('15/05/2019')">CLIQUE <tspan class="cls-12" x="29.09" y="0">A</tspan><tspan x="34.43" y="0">QUI</tspan></text><text class="cls-6" transform="translate(806.96 143.28)"><tspan class="cls-13">1</tspan><tspan x="11.31" y="0">6</tspan></text><text class="cls-5" transform="translate(845.12 112.28)">O presidente do Inep, <tspan x="0" y="12.5">Elmer Coelho Vicenzi, pediu</tspan><tspan x="0" y="25">demissão. O Delegado da Polícia</tspan><tspan x="0" y="37.5">Federal permaneceu apenas</tspan><tspan x="0" y="50">24 dias no cargo</tspan></text><text class="cls-6" transform="translate(885.96 545.28)">17</text><text class="cls-5" transform="translate(921.12 514.28)">Até agora, o<tspan x="0" y="12.5">Enem de 2019</tspan><tspan x="0" y="25">registrou 5,8 milhões</tspan><tspan x="0" y="37.5">de inscrições, segundo</tspan><tspan x="0" y="50">o Inep</tspan></text><use transform="translate(502.4 127.14) rotate(178.01) scale(0.25)" xlink:href="#image-2"/><use transform="translate(502.4 127.14) rotate(178.01) scale(0.25)" xlink:href="#image-2"/><use transform="matrix(-0.13, 0.13, 0.13, 0.13, 958.35, 551)" xlink:href="#image-2"/><use transform="matrix(-0.13, 0.13, 0.13, 0.13, 958.35, 551)" xlink:href="#image-2"/><use transform="matrix(-0.13, 0.13, 0.13, 0.13, 958.35, 551)" xlink:href="#image-2"/><rect class="cls-14" x="36" y="268" width="1000" height="135"/><g class="cls-15"><image width="1072" height="207" transform="translate(0 232)" xlink:href="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABDAAAADPCAYAAAADHyHJAAAACXBIWXMAAAsSAAALEgHS3X78AAAgAElEQVR4Xuy6bXIdSQ5kG3o2q5j977Pej2l0uQ7dgUiSUqW6cMxoNzMC3wCL0O3+8ddff51lWZZlWZZlWZZlWZY38/9NAsuyLMuyLMuyLMuyLP80+wXGsizLsizLsizLsiyvZ7/AWJZlWZZlWZZlWZbl9ewXGMuyLMuyLMuyLMuyvJ79AmNZlmVZlmVZlmVZltezX2Asy7Isy7Isy7Isy/J69guMZVmWZVmWZVmWZVlez36BsSzLsizLsizLsizL69kvMJZlWZZlWZZlWZZleT37BcayLMuyLMuyLMuyLK9nv8BYlmVZlmVZlmVZluX17BcYy7Isy7Isy7Isy7K8nv0CY1mWZVmWZVmWZVmW17NfYCzLsizLsizLsizL8nr2C4xlWZZlWZZlWZZlWV7PfoGxLMuyLMuyLMuyLMvr2S8wlmVZlmVZlmVZlmV5PfsFxrIsy7Isy7Isy7Isr2e/wFiWZVmWZVmWZVmW5fXsFxjLsizLsizLsizLsrye/QJjWZZlWZZlWZZlWZbXs19gLMuyLMuyLMuyLMvyevYLjGVZlmVZlmVZlmVZXs9+gbEsy7Isy7Isy7Isy+vZLzCWZVmWZVmWZVmWZXk9+wXGsizLsizLsizLsiyvZ7/AWJZlWZZlWZZlWZbl9ewXGMuyLMuyLMuyLMuyv
